s.aI(0,"Bouncing Ball",new A.b2r(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/bouncing_ball_example.dart","    This example shows how you can use the Collisions detection api to know when a ball\n    collides with the screen boundaries and then update it to bounce off these boundaries.\n  ")
s.aI(0,"Multiple shapes",new A.b2s(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/multiple_shapes_example.dart",'    An example with many hitboxes that move around on the screen and during\n    collisions they change color depending on what it is that they have collided\n    with. \n    \n    The snowman, the component built with three circles on top of each other, \n    works a little bit differently than the other components to show that you\n    can have multiple hitboxes within one component.\n    \n    On this example, you can "throw" the components by dragging them quickly in\n    any direction.\n  ')
